$(document).ready(function() {

    $('#text').keypress(function(event){

      if (event.keyCode == 10 || event.keyCode == 13)
      event.preventDefault();

    });
  });

var today = new Date();
  var dd = today.getDate();
  var mm = today.getMonth()+1; //January is 0!
  var yyyy = today.getFullYear();

  if(dd<10) {
    dd='0'+dd
  }

  if(mm<10) {
    mm='0'+mm
  }

  today = dd+'/'+mm+'/'+yyyy;
  document.write(today);

  $("button").click(function() {
    swal({
      title: "Do you want to save the tweet?",
      text: "Your tweet will not be saved if you close this page!",
      type: "success",
      showCancelButton: true,
      confirmButtonColor: "#A5DC86",
      confirmButtonText: "Download as a PDF",
      cancelButtonColor: "#DD6B55",
      cancelButtonText: "Cancel",
      closeOnConfirm: true,
      closeOnCancel: true },

      function(isConfirm){

        if (isConfirm) {
          swal("Saving!", "Your tweet has been downloaded as a PDF.", "success");

          //Get textarea value and split to three lines
          var fulltext = document.getElementById("text").value;

          var a = fulltext.match(/.{47}\w*\W*|.*/g);
          [1,2].forEach(function(i) { if (typeof a[i] === 'undefined' ) { a[i] = '' } });
          a.forEach(function(entry) {
            console.log(entry);
          });


          // date

          // jspdf options
          var imgData = 'data:image/jpeg;base64,';
          var doc = new jsPDF('landscape');
          doc.setFontSize(30);
          doc.setFont("helvetica");

          doc.addImage(imgData, 'JPEG', 15, 40, 45, 35);
          doc.text(30, 100, a[0] + ' ');
          doc.text(30, 120, a[1] + ' ');
          doc.text(30, 140, a[2] + ' ');
          doc.text(190, 160, today);


          doc.save('TwitterStatus.pdf');
        }

        else {

          swal("Printing", "Your tweet will print :)", "success");   }

        });
      });

